    fp2_decode(PublicKeyA + FP2_ENCODED_BYTES, PKB[1]);
    fp2_decode(PublicKeyA + 2*FP2_ENCODED_BYTES, PKB[2]);
    get_A(PKB[0], PKB[1], PKB[2], A);
    fpadd((digit_t*)&Montgomery_one, (digit_t*)&Montgomery_one, A24minus[0][0]);
